import React from 'react';
import line from '../img/line.png';

const Contacts = () => {
    return ( 
        <React.Fragment>
            <div className="body">
                <div className="container">
                    <div className="row justify-content-center">
                        <div className="col-lg-4 col-md-4">
                            <h1>Contacts</h1>
                            <img src={line} alt="" width='200'/>
                        </div>
                    </div>
                </div>
                
            </div>
        </React.Fragment>
    );
}
 
export default Contacts;
